import React from "react";
import styled from "styled-components";


class Streaming extends React.Component {
  state = {

  };
  componentDidMount() {}



  render() {
    return (
      <Style>
        <div id="box">
       <div id="row1">
     <a className="square" href="https://www.netflix.com"><img className="logo" src="data:image/png;base64,"/></a>
     <a className="square" href="https://www.hulu.com"> <img className="logo" src="https://www.privacymonitor.com/assets/logos/hulu.com.png" /></a>

     <a className="square" href="https://www.hbogo.com"><img className="logo" src="https://i2.wp.com/www.tggeeks.com/wp-content/uploads/2020/01/HBO-Logo-square.jpg?ssl=1" /></a>
     <a className="square" href="https://www.twitch.com"> <img className="logo" src="https://cdn3.iconfinder.com/data/icons/social-messaging-ui-color-shapes-2-free/128/social-twitch-square2-512.png" /></a>


       </div>
       <div id="row2">
       <a className="square" href="https://www.youtube.com"><img className="logo" src="https://cdn4.iconfinder.com/data/icons/social-messaging-ui-color-shapes-2-free/128/social-youtube-square1-512.png" /></a>
       <a className="square" href="https://www.abc.com"> <img className="logo" src="https://cdn1.edgedatg.com/aws/abc/brand/fall2018/abc-share-OG_170x170.jpg" /></a>
       <a className="square" href="https://www.cbs.com"> <img className="logo" src="https://trekmovie.com/wp-content/uploads/2017/09/cbs-aa-logo-square.jpg" /></a>
       <a className="square" href="https://www.spotify.com"> <img className="logo" src="https://developer.spotify.com/assets/branding-guidelines/icon3@2x.png" /></a>


       </div>
       </div>
      </Style>
    );
  }
}

const Style = styled.section`
.logo{
  width: 100%;
  outline: none;
  text-decoration: none;
}
#box{
  background-color: black;
  height: 32.33vh;
  border-radius: 15px;
  width: 99%;
}

  .square{
    width: 15%;
    margin: 2.4vh 3%;
    border-radius: 5px;
    border: 1px white solid;
    outline: none;
    text-decoration: none;
  }

  #row1{
    display: flex;
    justify-content: center;
  }
  #row2{
    display: flex;
    justify-content: center;
  }
`;

export default Streaming;
